import React from "react";
import Header from "./components/Header";
// import LoginForm from "./components/Login";
import { Routes, Route } from "react-router-dom";
import Auth from "./components/Auth";
function App() {
  return (
    <>
      <Header />
      <Routes>
        <Route path="/auth" element={<Auth />} />
      </Routes>
    </>
  );
}

export default App;
